(9, '2014 Budmerice OPEN', '2014-04-05', '2023-01-17', 'Budmerice', 1, 6, 1, '<p><span style="font-family: arial,sans-serif;"><span style="font-size: small;"><strong>P<span style="font-size: small;">ozor</span></strong>:</span> alej topolov, cesta, po ktorej sme boli zvyknut&iacute; pr&iacute;s?, je uzavret&aacute;, treba to ob&iacute;s? cez prv&uacute; praleln&uacute; ulicu v dedine (Revolučn&aacute; ulica).&nbsp; <br /><strong>Parkovanie:</strong> vzh?adom na to, že nem&aacute;m potvrden&yacute; pr&iacute;stup do parku je možn&eacute;, že budeme musie? parkova? pred br&aacute;nou, na mape vyzna?en&eacute; modrou farbou. V&scaron;etky cennosti si v aute odložte pre istotu do kufra. <br /><span style="color: #783f04;"><span style="text-decoration: underline;"><strong><span style="font-size: medium;"><br /><span style="color: #4c1130;"><span style="font-size: small;">W<span style="font-size: small;">arning</span></span></span></span></strong></span><span style="color: #4c1130;">: the tree alley we used to access the park is now closed for traffic. Therefore you need to use a detour through the first parallel street in the village (Revolucna ulica). Just follow the street to the end, then turn left, see the map on the right of this page.&nbsp; <br /> <strong>Parking:</strong> we still do not have a confirmation of parking inside the park area, so it is possible that you will need to park outside the park fence (indicated by the blue color on the map). Please, do not leave any visible valuables in your car and leave all your&nbsp; stuff in the car trunk! </span></span><br /><br /><br /><strong><span style="font-size: medium;">JEDLO/FOOD</span></strong></span><br /><span style="font-family: arial,sans-serif;"><span style="font-size: medium;"><span style="font-size: small;">Voda a mal&eacute; ob?er<span style="font-size: small;">tvenie <span style="font-size: small;">s&uacute; zahrnut&eacute; v turnajovom poplatku. <span style="font-size: small;">V obci je viacero možnost&iacute; <span style="font-size: small;">na obed a ve?eru v sobotu a nede?u s cenami od 5 Euro. Odpor&uacute;?an&aacute; re&scaron;taur&aacute;cia je </span></span></span></span></span></span><br /></span><span style="font-family: arial,sans-serif;"><span style="font-size: medium;"><span style="font-size: small;"><span style="font-family: arial,sans-serif;"><span style="font-size: medium;"><span style="font-size: small;"><a href="https://plus.google.com/103123951796227980920/about?hl=sk" target="_blank"><span style="font-size: small;">Re&scaron;taur&aacute;cia </span>KVAK</a> , <a href="http://kvakrestaurant.webnode.sk/kontakt/" target="_blank" rel="nofollow">alternat&iacute;<span style="font-size: small;">vny</span> link</a> (o<span style="font-size: small;">tvoren&eacute;</span> sobota 12:00 - 24:00 a<span style="font-size: small;"> <span style="font-size: small;">nede?a</span></span> 12:00 - 22:00)<br /><span style="color: #4c1130;"><a href="https://sites.google.com/site/regnadgtur/goog_781703377"><br /></a></span></span></span></span></span></span></span><span style="color: #4c1130;">Water and small snack are included in the player fee. Multiple lunch and dinner options in the village are available on Saturday and Sunday starting at 5 Eur, <br />recommended option <a target="_blank">KVAK restaurant</a> , <a target="_blank">alternative link</a> (open Saturday 12:00 - 24:00 and Sunday 12:00 - 22:00)</span><br /><span style="font-family: arial,sans-serif;"><strong><span style="font-size: medium;"><span style="text-decoration: underline;"><br /></span></span></strong></span><span style="font-family: arial,sans-serif;"><strong><span style="font-size: medium;">ACCOMMODATION/UBYTOVANIE</span></strong></span></p>\n<div style="display: inline; margin: 5px 10px; float: right;"><a href="https://sites.google.com/site/regnadgtur/budmerice-2013/budmerice%202.png?attredirects=0"><img src="https://sites.google.com/site/regnadgtur/_/rsrc/1367567440933/budmerice-2013/budmerice%202.png?height=320&amp;width=400" alt="" width="400" height="320" border="0" /></a></div>\n<p><br />UNISTAV, Jablonecka 2, Budmerice, 48.353536,17.416451&nbsp;<span style="font-size: small;"><a href="https://maps.google.sk/maps?q=48.353606,17.416395&amp;hl=sk&amp;num=1&amp;t=h&amp;z=19" target="_blank">Mapa</a></span>, <span style="font-size: small;">v žltom kruhu na mape</span> hore<br /><span style="font-family: arial,sans-serif;"><span style="font-size: medium;"><span style="font-size: small;">robot<span style="font-size: small;">n&iacute;<span style="font-size: small;">c</span>k<span style="font-size: small;">a</span> ubytov<span style="font-size: small;">?a</span> 6&euro; za osobu a noc <br /><span style="font-size: small;">hotelov<span style="font-size: small;">&aacute;</span> ?as<span style="font-size: small;">?</span> 12&euro; za o<span style="font-size: small;">sobu a <span style="font-size: small;">noc</span></span></span></span></span></span></span><br /><span style="font-family: arial,sans-serif;"><span style="font-size: medium;"><span style="font-size: small;"><span style="font-size: small;"><span style="font-size: small;"><span style="font-size: small;">mo<span style="font-size: small;">ž<span style="font-size: small;">nos? <span style="font-size: small;">ra?ajok</span> <span style="font-size: small;">n<span style="font-size: small;">a</span></span> <span style="font-size: small;">ned<span style="font-size: small;">e<span style="font-size: small;">?u</span></span></span></span></span></span></span></span></span></span> <span style="font-size: small;"><span style="font-size: small;">cca</span>.</span> 3&euro; <br /></span><br /><span style="color: #4c1130;">UNISTAV, Jablonecka 2, Budmerice, 48.353536,17.416451&nbsp;<span style="font-size: small;"><a href="https://maps.google.sk/maps?q=48.353606,17.416395&amp;hl=sk&amp;num=1&amp;t=h&amp;z=19" target="_blank">Map</a></span>, see also yellow circle on the map above<br /> basic accommodation 6&euro; per nigh