n: underline;"><span style="font-family: arial,sans-serif;"><strong><span style="font-size: medium;"><span style="text-decoration: underline;"><br /></span></span></strong></span><br /></span>P<span style="font-size: medium;">ROGRAM<span style="font-size: medium;">/TOURNAMENT <span style="font-size: medium;">SCHEDULE</span></span></span></span></strong><br /></span><span style="font-family: arial,sans-serif;"><span style="font-family: arial,sans-serif;">Pros&iacute;me, každ&uacute; skupinu, ktor&aacute; dohr&aacute; 4.kolo v sobotu, aby priniesla k&ocirc;&scaron; ku ka&scaron;tielu<br /><br /></span><span style="font-family: arial,sans-serif;"><span style="color: #4c1130;">We kindly ask all the players'' flights that finishes the 4th round on Saturday to bring the basket to the meeting area. </span></span><br /><br /><strong>Saturday April 20, 2013</strong><br />09:00 - Registration - </span><span style="font-family: arial,sans-serif;"><span lang="en">pay entry fee<br /></span>09:30 - Players meeting<br />09:45 - First and second round&nbsp; (2 x 12 holes together)<br />12:30 - Lunch break <br />14:45 - Players meeting<br /> 15:00 - Third and fourth round </span><span style="font-family: arial,sans-serif;"><span style="font-family: arial,sans-serif;">(2 x 12 holes together)</span><br /><br /></span></p>\n<div>\n<div class="sites-embed-align-right-wrapping-on">\n<div class="sites-embed-border-on sites-embed" style="width: 400px;">\n<h4 class="sites-embed-title">Budmerice Spring Fling 2013 - registr&aacute;cia</h4>\n<div class="sites-embed-content sites-embed-type-spreadsheet-form">&nbsp;</div>\n</div>\n</div>\n</div>\n<p><span style="font-family: arial,sans-serif;"><strong>Sunday April 21, 2013</strong><br />09:30 - Players meeting<br />09:45 - Fifth and sixth round&nbsp; </span><span style="font-family: arial,sans-serif;"><span style="font-family: arial,sans-serif;">(2 x 12 holes together)</span><br />12:30 - Short Break<br />13:00 - Final round (the best 5 players 